const options = {
  minZoom: 8,
  styles: [
    {
      featureType: "landscape",
      stylers: [
        { visibility: "off" }
      ]
    },
    {
      featureType: "road",
      elementType: "labels",
      stylers: [
        { visibility: "simplified" }
      ]
    },
    {
      featureType: "administrative.province",
      elementType: "geometry",
      stylers: [
        { color: "#000000" },
        { weight: 2 }
      ]
    },
    {
      featureType: "poi",
      stylers: [
        { visibility: "off" }
      ]
    }
  ]
}

export default options
